eval("// Module\nvar code = \"<!DOCTYPE html>\\n<html lang=\\\"en\\\">\\n<head>\\n<meta charset=\\\"UTF-8\\\">\\n<!--[if IE]><meta http-equiv=\\\"X-UA-Compatible\\\" content=\\\"IE=edge\\\"><![endif]-->\\n<meta name=\\\"viewport\\\" content=\\\"width=device-width, initial-scale=1.0\\\">\\n<meta name=\\\"generator\\\" content=\\\"Asciidoctor 1.5.7.1\\\">\\n<title>Projement back-end</title>\\n<style>\\n@import \\\"https://fonts.googleapis.com/css?family=Open+Sans:300,300italic,400,400italic,600,600italic%7CNoto+Serif:400,400italic,700,700italic%7CDroid+Sans+Mono:400,700\\\";\\n@import \\\"https://cdn.jsdelivr.net/gh/asciidoctor/asciidoctor@2.0/data/stylesheets/asciidoctor-default.css\\\";\\n\\nblockquote {\\n    border-left: 4px solid #cccccc;\\n    margin-left: 2px;\\n    padding-left: 1em;\\n}\\n\\np {\\n    font-size: 16px;\\n}\\n\\npre {\\n    padding: 8px;\\n    background-color: #f2f2f2;\\n}\\n\\nh1 {\\n    margin-bottom: 1rem;\\n    font-size: 2.5rem;\\n}\\n\\nh2 {\\n    border-bottom: 2px solid #cccccc;\\n    margin-top: 1.5rem;\\n    padding-bottom: 0.5rem;\\n    margin-bottom: 1rem;\\n    font-size: 2rem;\\n}\\n\\nh3 {\\n    font-size: 1.75rem;\\n    margin-bottom: 0.75rem;\\n}\\n\\nh4 {\\n    padding: 8px;\\n    background-color: #18BC9C;\\n    color: white;\\n    font-weight: bold;\\n    font-size: 1.3rem;\\n    border-radius: 2px;\\n    margin-bottom: 1rem;\\n    margin-top: 1.5rem;\\n}\\n\\nh5 {\\n    background-color: #f2f2f2;\\n    font-weight: bold;\\n    padding: 12px;\\n    margin: 1rem 0 1.5rem;\\n    font-size: 1.1rem;\\n    line-height: 1.5rem;\\n}\\n\\np + ul {\\n    margin-top: -0.4rem;\\n}\\n\\nul {\\n    padding-left: 18px;\\n}\\n\\nli {\\n    font-size: 1rem;\\n}\\n\\n\\n</style>\\n</head>\\n<body class=\\\"article\\\">\\n<div id=\\\"header\\\">\\n<h1>Projement back-end</h1>\\n<div id=\\\"toc\\\" class=\\\"toc\\\">\\n<div id=\\\"toctitle\\\">Table of Contents</div>\\n<ul class=\\\"sectlevel1\\\">\\n<li><a href=\\\"#_apps\\\">Apps</a></li>\\n<li><a href=\\\"#_linting\\\">Linting</a></li>\\n<li><a href=\\\"#_front_end\\\">Front-end</a></li>\\n</ul>\\n</div>\\n</div>\\n<div id=\\\"content\\\">\\n<div id=\\\"preamble\\\">\\n<div class=\\\"sectionbody\\\">\\n<div class=\\\"paragraph\\\">\\n<p>The back-end consists of a Docker container with <em>Python 3.8</em> and <em>Django 2.2</em>.</p>\\n</div>\\n<div class=\\\"paragraph\\\">\\n<p>All Python package requirements are listed in\\n<a href=\\\"../requirements.txt\\\"><code>requirements.txt</code></a>. The initial requirements include:</p>\\n</div>\\n<div class=\\\"ulist\\\">\\n<ul>\\n<li>\\n<p><a href=\\\"https://docs.djangoproject.com/en/2.2/\\\">Django</a> as the base framework</p>\\n</li>\\n<li>\\n<p><a href=\\\"http://django-crispy-forms.readthedocs.io/en/latest/\\\">django-crispy-forms</a>\\nfor easier form layouts for server-rendered forms</p>\\n</li>\\n<li>\\n<p><a href=\\\"http://pythonhosted.org/Markdown/siteindex.html\\\">markdown</a> for rendering\\nmarkdown in HTML</p>\\n</li>\\n<li>\\n<p><a href=\\\"https://www.django-rest-framework.org/\\\">djangorestframework</a> for creating the\\nAPI for the front-end to consume</p>\\n</li>\\n<li>\\n<p><a href=\\\"https://docs.pytest.org\\\">pytest</a> for writing tests</p>\\n</li>\\n<li>\\n<p><a href=\\\"https://github.com/psf/black\\\">black</a> for linting and automatically formatting\\nthe code</p>\\n</li>\\n<li>\\n<p><a href=\\\"https://django-debug-toolbar.readthedocs.io/en/latest/index.html\\\">Django Debug\\nToolbar</a> to\\nhelp with debugging</p>\\n</li>\\n</ul>\\n</div>\\n<div class=\\\"paragraph\\\">\\n<p>If you&#8217;d like to install additional dependencies, add them to the\\n<a href=\\\"../requirements.txt\\\"><code>requirements.txt</code></a> file and rebuild the Docker containers\\nwith <code>make build</code>.</p>\\n</div>\\n<div class=\\\"paragraph\\\">\\n<p>The application uses the <em>SQLite</em> database back-end by default.</p>\\n</div>\\n</div>\\n</div>\\n<div class=\\\"sect1\\\">\\n<h2 id=\\\"_apps\\\">Apps</h2>\\n<div class=\\\"sectionbody\\\">\\n<div class=\\\"paragraph\\\">\\n<p>There are two Django <code>apps</code> in this application:</p>\\n</div>\\n<div class=\\\"ulist\\\">\\n<ul>\\n<li>\\n<p><a href=\\\"auth\\\"><code>auth</code></a> app - Authentication concerns like logging the user in through\\nthe login form.</p>\\n</li>\\n<li>\\n<p><a href=\\\"projects\\\"><code>projects</code></a> app - The core business logic of the application –\\nkeeping track of time spent on projects. Exposes a REST API that can be\\nconsumed by the front-end. Everything related to the API is in the\\n<a href=\\\"projects/rest\\\"><code>projects/rest/</code></a> folder. This includes very standard Django\\nREST Framework viewsets in <a href=\\\"projects/rest/views.py\\\"><code>rest/views.py</code></a>,\\nserializers in <a href=\\\"projects/rest/serializers.py\\\"><code>rest/serializers.py</code></a>, and\\nregistering the routes from those viewsets in\\n<a href=\\\"projects/rest/urls.py\\\"><code>rest/urls.py</code></a>.</p>\\n</li>\\n</ul>\\n</div>\\n<div class=\\\"paragraph\\\">\\n<p>There are also some tests in the <a href=\\\"auth/tests.py\\\"><code>auth/tests.py</code></a> and\\n<a href=\\\"projects/tests\\\"><code>projects/tests</code></a> folders and files.</p>\\n</div>\\n</div>\\n</div>\\n<div class=\\\"sect1\\\">\\n<h2 id=\\\"_linting\\\">Linting</h2>\\n<div class=\\\"sectionbody\\\">\\n<div class=\\\"paragraph\\\">\\n<p><a href=\\\"https://github.com/psf/black\\\">Black</a> is used to automatically format and lint\\nfiles. The <code>make lint-django</code> command checks that the project is correctly\\nformatted.</p>\\n</div>\\n<div class=\\\"paragraph\\\">\\n<p>You can set up your editor to automatically format Python files using Black\\nfollowing the instructions <a href=\\\"https://github.com/psf/black#editor-integration\\\">on Black&#8217;s GitHub\\npage</a>.</p>\\n</div>\\n<div class=\\\"paragraph\\\">\\n<p>You can also use the <code>make lint-django-fix</code> command to automatically format all\\nPython files in the project.</p>\\n</div>\\n</div>\\n</div>\\n<div class=\\\"sect1\\\">\\n<h2 id=\\\"_front_end\\\">Front-end</h2>\\n<div class=\\\"sectionbody\\\">\\n<div class=\\\"paragraph\\\">\\n<p>The front-end is a React app that&#8217;s rendered through Django. This means that\\nDjango renders a template (<a href=\\\"templates/app.html\\\"><code>app.html</code></a>) and inside that\\ntemplate, <code>ReactDOM.render</code> is manually called (<code>projement.init()</code> calls the\\n<code>init</code> function in <a href=\\\"app/src/main.js\\\"><code>app/src/main.js</code></a>).</p>\\n</div>\\n<div class=\\\"paragraph\\\">\\n<p>Read more about how the front-end works in the <a href=\\\"app/README.adoc\\\">front-end\\n<code>README.adoc</code></a>.</p>\\n</div>\\n</div>\\n</div>\\n</div>\\n<div id=\\\"footer\\\">\\n<div id=\\\"footer-text\\\">\\nLast updated 2023-01-31 11:36:26 UTC\\n</div>\\n</div>\\n</body>\\n</html>\";\n// Exports\nmodule.exports = code;//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///../../BE.html\n");

