eval("// Module\nvar code = \"<!DOCTYPE html>\\n<html lang=\\\"en\\\">\\n<head>\\n<meta charset=\\\"UTF-8\\\">\\n<!--[if IE]><meta http-equiv=\\\"X-UA-Compatible\\\" content=\\\"IE=edge\\\"><![endif]-->\\n<meta name=\\\"viewport\\\" content=\\\"width=device-width, initial-scale=1.0\\\">\\n<meta name=\\\"generator\\\" content=\\\"Asciidoctor 1.5.7.1\\\">\\n<title>Projement front-end</title>\\n<style>\\n@import \\\"https://fonts.googleapis.com/css?family=Open+Sans:300,300italic,400,400italic,600,600italic%7CNoto+Serif:400,400italic,700,700italic%7CDroid+Sans+Mono:400,700\\\";\\n@import \\\"https://cdn.jsdelivr.net/gh/asciidoctor/asciidoctor@2.0/data/stylesheets/asciidoctor-default.css\\\";\\n\\nblockquote {\\n    border-left: 4px solid #cccccc;\\n    margin-left: 2px;\\n    padding-left: 1em;\\n}\\n\\np {\\n    font-size: 16px;\\n}\\n\\npre {\\n    padding: 8px;\\n    background-color: #f2f2f2;\\n}\\n\\nh1 {\\n    margin-bottom: 1rem;\\n    font-size: 2.5rem;\\n}\\n\\nh2 {\\n    border-bottom: 2px solid #cccccc;\\n    margin-top: 1.5rem;\\n    padding-bottom: 0.5rem;\\n    margin-bottom: 1rem;\\n    font-size: 2rem;\\n}\\n\\nh3 {\\n    font-size: 1.75rem;\\n    margin-bottom: 0.75rem;\\n}\\n\\nh4 {\\n    padding: 8px;\\n    background-color: #18BC9C;\\n    color: white;\\n    font-weight: bold;\\n    font-size: 1.3rem;\\n    border-radius: 2px;\\n    margin-bottom: 1rem;\\n    margin-top: 1.5rem;\\n}\\n\\nh5 {\\n    background-color: #f2f2f2;\\n    font-weight: bold;\\n    padding: 12px;\\n    margin: 1rem 0 1.5rem;\\n    font-size: 1.1rem;\\n    line-height: 1.5rem;\\n}\\n\\np + ul {\\n    margin-top: -0.4rem;\\n}\\n\\nul {\\n    padding-left: 18px;\\n}\\n\\nli {\\n    font-size: 1rem;\\n}\\n\\n\\n</style>\\n</head>\\n<body class=\\\"article\\\">\\n<div id=\\\"header\\\">\\n<h1>Projement front-end</h1>\\n<div id=\\\"toc\\\" class=\\\"toc\\\">\\n<div id=\\\"toctitle\\\">Table of Contents</div>\\n<ul class=\\\"sectlevel1\\\">\\n<li><a href=\\\"#_folder_structure\\\">Folder structure</a></li>\\n<li><a href=\\\"#_testing\\\">Testing</a></li>\\n<li><a href=\\\"#_routing\\\">Routing</a></li>\\n<li><a href=\\\"#_redux_store\\\">Redux store</a></li>\\n<li><a href=\\\"#_communication_with_the_back_end\\\">Communication with the back-end</a></li>\\n<li><a href=\\\"#_forms\\\">Forms</a></li>\\n<li><a href=\\\"#_linting\\\">Linting</a>\\n<ul class=\\\"sectlevel2\\\">\\n<li><a href=\\\"#_formatting\\\">Formatting</a></li>\\n</ul>\\n</li>\\n<li><a href=\\\"#_notes\\\">Notes</a></li>\\n</ul>\\n</div>\\n</div>\\n<div id=\\\"content\\\">\\n<div id=\\\"preamble\\\">\\n<div class=\\\"sectionbody\\\">\\n<div class=\\\"paragraph\\\">\\n<p>The front-end of this application is a React app that&#8217;s rendered inside a Django\\ntemplate (<a href=\\\"../templates/app.html\\\"><code>app.html</code></a>) and that fetches required data\\nfrom the REST API that the back-end exposes.</p>\\n</div>\\n</div>\\n</div>\\n<div class=\\\"sect1\\\">\\n<h2 id=\\\"_folder_structure\\\">Folder structure</h2>\\n<div class=\\\"sectionbody\\\">\\n<div class=\\\"paragraph\\\">\\n<p>The source code for the front-end is in the <a href=\\\"src\\\"><code>src/</code></a> folder. The webpack\\nconfiguration is in the <a href=\\\"webpack\\\"><code>webpack/</code></a> folder and the built JavaScript\\nfiles that Django will serve are built to the <a href=\\\"build\\\"><code>build/</code></a> folder (You most\\nlikely don&#8217;t need to touch either of these directories).</p>\\n</div>\\n<div class=\\\"paragraph\\\">\\n<p>The <code>src/</code> folder is split into folders by \\\"domain\\\", so the folder structure\\nlooks similar to the Django project. Instead of having a few folders at the top\\nlevel like <code>src/components/</code> and <code>src/pages/</code>, the first folders should be\\nsimilar to the Django <code>apps</code>. Each front-end <code>app</code> can include a few different\\nkinds of files and folders. Let&#8217;s take the <code>projects</code> example:</p>\\n</div>\\n<div class=\\\"listingblock\\\">\\n<div class=\\\"content\\\">\\n<pre class=\\\"highlight\\\"><code class=\\\"language-text\\\" data-lang=\\\"text\\\">projects\\n├── ducks                             // Redux ducks related to this project (check out the Redux section in this readme)\\n├── forms                             // Forms built using Formik\\n│   ├── EditProjectForm               // The form for editing the time spent on a project\\n│   │   ├── EditProjectForm.js        // The component is declared here\\n│   │   ├── EditProjectForm.test.js   // And the tests for that component\\n│   │   └── index.js                  // This exports the component so that it can be imported like so:\\n│   │                                 // `import EditProjectForm from 'projects/forms/EditProjectForm'`\\n│   └── index.js                      // This exports all forms so that it's even more convenient to\\n│                                     // import: `import { EditProjectForm } from 'projects/forms'`\\n├── pages                             // Pages related to projects, just normal react components\\n│   ├── DashboardPage                 // Follows the same structure as a component\\n│   ├── EditProjectPage\\n│   └── index.js\\n├── propTypes.js                      // React Prop Types related to projects\\n└── testUtils.js                      // Some test utilities (for example, generating a mock project object)</code></pre>\\n</div>\\n</div>\\n<div class=\\\"paragraph\\\">\\n<p>The other <code>app</code> in the front-end is <a href=\\\"src/core\\\"><code>core</code></a>. This includes things\\nthat are not really related to any specific <code>app</code> but are related to the\\napplication as a whole. So, things like the <a href=\\\"src/core/Navbar\\\"><code>Navbar</code>\\ncomponent</a>, utility components like\\n<a href=\\\"src/core/PrivateRoute\\\"><code>PrivateRoute</code></a>, and utilities like\\n<a href=\\\"src/core/testUtils.js\\\"><code>testUtils</code></a> go here. Also, the <code>core</code> app includes\\ngeneric \\\"set up\\\" and configuration files. For example, setting up the Redux\\nstore happens in <a href=\\\"src/core/store.js\\\"><code>store.js</code></a>.</p>\\n</div>\\n</div>\\n</div>\\n<div class=\\\"sect1\\\">\\n<h2 id=\\\"_testing\\\">Testing</h2>\\n<div class=\\\"sectionbody\\\">\\n<div class=\\\"paragraph\\\">\\n<p><a href=\\\"https://testing-library.com/docs/react-testing-library/intro\\\">React Testing\\nLibrary</a> is used\\nfor testing React components in this project. It features a limited API to test\\nReact components exactly like how they are used by the users of the application.\\nThis means that there&#8217;s no testing of internal states, props or method\\ninvocations, the main things that should be tested are the things that the user\\ncan see and interact with.</p>\\n</div>\\n<div class=\\\"paragraph\\\">\\n<p>Test files are located next to the thing that they are testing. For example, the\\ntests for <code>Navbar.js</code> are located in the <code>Navbar.test.js</code> file next to\\n<code>Navbar.js</code>.</p>\\n</div>\\n<div class=\\\"paragraph\\\">\\n<p>You can run front-end tests with the <code>make test-node</code> command.</p>\\n</div>\\n<div class=\\\"paragraph\\\">\\n<p>If you want to test things related to routing, Redux or HTTP requests, check out\\nthe sections for those (<a href=\\\"#routing\\\">Routing</a>, <a href=\\\"#redux-store\\\">Redux store</a> and\\n<a href=\\\"#communication-with-the-back-end\\\">Communication with the back-end</a>).</p>\\n</div>\\n</div>\\n</div>\\n<div class=\\\"sect1\\\">\\n<h2 id=\\\"_routing\\\">Routing</h2>\\n<div class=\\\"sectionbody\\\">\\n<div class=\\\"paragraph\\\">\\n<p><a href=\\\"https://reacttraining.com/react-router/\\\">React Router</a> is used for routing in\\nthe front-end. The routes are declared in the <a href=\\\"src/core/App.js\\\"><code>App</code>\\ncomponent</a>. There is also a utility component\\n<a href=\\\"src/core/PrivateRoute\\\"><code>PrivateRoute</code></a> that redirects the user to the login\\npage if they are not logged in.</p>\\n</div>\\n<div class=\\\"paragraph\\\">\\n<p>An example on how to test components that depend on the router can be seen in\\nthe\\n<a href=\\\"src/projects/forms/EditProjectPage/EditProjectPage.test.js\\\"><code>EditProjectPage.test.js</code></a>.\\nIn a nutshell, the component needs to be rendered inside a React Router <code>Router</code>\\ncomponent and it might be necessary to wrap it in a <code>Route</code> component as well.\\nThe utility for this is the <a href=\\\"src/core/testUtils.js\\\"><code>renderWithContext</code> function in the core test\\nutilities</a>.</p>\\n</div>\\n<div class=\\\"paragraph\\\">\\n<p><em>Note</em> that this is generally not how we do routing in our projects but this\\nsolution is quite simple and works well enough for a test assignment.</p>\\n</div>\\n</div>\\n</div>\\n<div class=\\\"sect1\\\">\\n<h2 id=\\\"_redux_store\\\">Redux store</h2>\\n<div class=\\\"sectionbody\\\">\\n<div class=\\\"paragraph\\\">\\n<p>Most of our projects use Redux for state management. There&#8217;s not a whole lot\\nthere, but it&#8217;s similar to how it&#8217;s set up in most of our projects. We use Ducks\\nas a way to organize our Redux store. In a nutshell, this means that all related\\nreducers/actions/selectors/etc. are located next to each other in one file. You\\ncan read more about the Ducks idea here:\\n<a href=\\\"https://github.com/erikras/ducks-modular-redux/\\\"><code>ducks-modular-redux</code></a>.</p>\\n</div>\\n<div class=\\\"paragraph\\\">\\n<p>Generally, Ducks can include the following logic:</p>\\n</div>\\n<div class=\\\"ulist\\\">\\n<ul>\\n<li>\\n<p>Actions</p>\\n</li>\\n<li>\\n<p>Reducers</p>\\n</li>\\n<li>\\n<p>Action creators</p>\\n</li>\\n<li>\\n<p>Asynchronous action creators for making HTTP requests, for example (using\\n<a href=\\\"https://github.com/reduxjs/redux-thunk\\\">Redux Thunk</a>)</p>\\n</li>\\n<li>\\n<p>Selectors</p>\\n</li>\\n</ul>\\n</div>\\n<div class=\\\"paragraph\\\">\\n<p>In this application, the only Duck we have is the <a href=\\\"src/projects/ducks/projects.js\\\"><code>projects</code>\\nduck</a>. It includes the following logic:</p>\\n</div>\\n<div class=\\\"ulist\\\">\\n<ul>\\n<li>\\n<p>Fetching the projects - <code>fetchProjects</code> function</p>\\n</li>\\n<li>\\n<p>Update a project - <code>updateProject</code> function</p>\\n</li>\\n<li>\\n<p>Store the projects in the Redux store - action creators and reducers</p>\\n</li>\\n<li>\\n<p>Keep track of the loading state for projects</p>\\n</li>\\n<li>\\n<p>Selectors for selecting data from the Redux store</p>\\n</li>\\n</ul>\\n</div>\\n<div class=\\\"paragraph\\\">\\n<p>The whole Redux store for the application is quite small:</p>\\n</div>\\n<div class=\\\"listingblock\\\">\\n<div class=\\\"content\\\">\\n<pre class=\\\"highlight\\\"><code class=\\\"language-js\\\" data-lang=\\\"js\\\">{\\n    projects: {\\n        projects: [  // List of projects as they are received from the API\\n            {id: 1, name: 'GateMe', company: {...}, ...}\\n        ],\\n        isLoading: false,  // If anything related to projects is loading\\n    },\\n}</code></pre>\\n</div>\\n</div>\\n<div class=\\\"paragraph\\\">\\n<p>If you want to test a component that wants to use the Redux store, you can use\\nthe <code>renderWithContext</code> utility function from\\n<a href=\\\"src/core/testUtils.js\\\"><code>testUtils</code></a> to wrap the component in a Redux provider.\\nSee an example in\\n<a href=\\\"src/projects/pages/DashboardPage/DashboardPage.test.js\\\"><code>DashboardPage.test.js</code></a>.</p>\\n</div>\\n</div>\\n</div>\\n<div class=\\\"sect1\\\">\\n<h2 id=\\\"_communication_with_the_back_end\\\">Communication with the back-end</h2>\\n<div class=\\\"sectionbody\\\">\\n<div class=\\\"paragraph\\\">\\n<p>The communication with the back-end is done via HTTP requests to various API\\nendpoints to <code>/api/*</code> URLs.</p>\\n</div>\\n<div class=\\\"paragraph\\\">\\n<p>As briefly mentioned in the Redux store section, this project uses Redux Thunk\\nto make HTTP requests. This means that a component can conveniently dispatch an\\naction to start any kind of HTTP request. For example, the <a href=\\\"src/projects/pages/DashboardPage/DashboardPage.js\\\"><code>DashboardPage</code>\\ncomponent</a> calls\\n<code>fetchProjects()</code> if the component wants to trigger the fetching of projects.</p>\\n</div>\\n<div class=\\\"paragraph\\\">\\n<p>If you want to test a component that makes some HTTP requests, you can use\\n<a href=\\\"http://www.wheresrhys.co.uk/fetch-mock/\\\"><code>fetch-mock</code></a> to mock the HTTP\\nrequest. See an example in\\n<a href=\\\"src/projects/pages/DashboardPage/DashboardPage.test.js\\\"><code>DashboardPage.test.js</code></a>.</p>\\n</div>\\n</div>\\n</div>\\n<div class=\\\"sect1\\\">\\n<h2 id=\\\"_forms\\\">Forms</h2>\\n<div class=\\\"sectionbody\\\">\\n<div class=\\\"paragraph\\\">\\n<p>We generally use <a href=\\\"https://github.com/jaredpalmer/formik\\\">Formik</a> to build forms.\\nAn example of this can be seen in the\\n<a href=\\\"src/projects/forms/EditProjectForm/EditProjectForm.js\\\"><code>EditProjectForm</code></a>.</p>\\n</div>\\n</div>\\n</div>\\n<div class=\\\"sect1\\\">\\n<h2 id=\\\"_linting\\\">Linting</h2>\\n<div class=\\\"sectionbody\\\">\\n<div class=\\\"paragraph\\\">\\n<p>ESLint and Prettier are set up and should work out of the box. You can run <code>make\\neslint</code> to check your code for linting errors.</p>\\n</div>\\n<div class=\\\"sect2\\\">\\n<h3 id=\\\"_formatting\\\">Formatting</h3>\\n<div class=\\\"paragraph\\\">\\n<p><code>make eslint-fix</code> will have eslint try to fix any errors which it is able to.</p>\\n</div>\\n</div>\\n</div>\\n</div>\\n<div class=\\\"sect1\\\">\\n<h2 id=\\\"_notes\\\">Notes</h2>\\n<div class=\\\"sectionbody\\\">\\n<div class=\\\"paragraph\\\">\\n<p>Depending on your development environment set up, you might need to install the\\n<code>npm</code> packages locally (it can help your editor with autocompletion and\\nlinting):</p>\\n</div>\\n<div class=\\\"listingblock\\\">\\n<div class=\\\"content\\\">\\n<pre class=\\\"highlight\\\"><code class=\\\"language-bash\\\" data-lang=\\\"bash\\\"># From the project root\\ncd projement\\nnpm install</code></pre>\\n</div>\\n</div>\\n<div class=\\\"paragraph\\\">\\n<p>You should now have the packages installed locally to <code>projement/node_modules</code>\\nand you should be able to run <code>npm</code> scripts locally (not through Docker):</p>\\n</div>\\n<div class=\\\"listingblock\\\">\\n<div class=\\\"content\\\">\\n<pre class=\\\"highlight\\\"><code class=\\\"language-bash\\\" data-lang=\\\"bash\\\">npm run test\\nnpm run lint</code></pre>\\n</div>\\n</div>\\n</div>\\n</div>\\n</div>\\n<div id=\\\"footer\\\">\\n<div id=\\\"footer-text\\\">\\nLast updated 2023-01-31 11:36:26 UTC\\n</div>\\n</div>\\n</body>\\n</html>\";\n// Exports\nmodule.exports = code;//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///../../FE.html\n");

